class PersonDetail extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <>
        <p>This is child number {this.props.match.params.id}</p>
        <h3>Nombre: {this.props.match.params.user.name}</h3>
      </>
    );
  }
}

export default PersonDetail;
